pragma solidity ^0.8.17;

interface IERC20 {
    function totalSupply() external view returns (uint256);

    function balanceOf(address account) external view returns (uint256);

    function transfer(address recipient, uint256 amount)
        external
        returns (bool);

    function allowance(address owner, address spender)
        external
        view
        returns (uint256);

    function approve(address spender, uint256 amount) external returns (bool);

    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) external returns (bool);
}

abstract contract Context {
    function _msgSender() internal view virtual returns (address) {
        return msg.sender;
    }
}

contract Token is Context, IERC20 {
    mapping(address => uint256) private _balances;
    mapping(address => mapping(address => uint256)) private _allowances;

    mapping(address => bool) private _isBlocked; // was `storage_map_e`
    mapping(address => bool) private _isExcludedMaxTransactionAmount;

    uint256 private _totalSupply = 1_000_000_000 * 1e18;

    /* ------ Anti-bot / Trading Controls ------ */
    bool public tradingActive = false;
    bool public transferDelayEnabled = true;
    bool public limitsInEffect = true;

    uint256 public maxTransactionAmount;
    uint256 public maxWallet;

    /* ------ Events ------ */
    event BoughtEarly(address indexed sniper);
    event ExcludeFromFees(address indexed account, bool isExcluded);

    /* ------ Constructor ------ */
    constructor() {
        _balances[_msgSender()] = _totalSupply;
        emit Transfer(address(0), _msgSender(), _totalSupply);
    }

    /* ---------------------------------------------------- */
    /*                 IERC20  Standard                     */
    /* ---------------------------------------------------- */

    function name() external pure returns (string memory) {
        return "Token";
    }

    function symbol() external pure returns (string memory) {
        return "TKN";
    }

    function decimals() external pure returns (uint8) {
        return 18;
    }

    function totalSupply() external view override returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address account)
        public
        view
        override
        returns (uint256)
    {
        return _balances[account];
    }

    /* ------------------------------------------------------------------ */
    /*                    ***  REFINED FUNCTION  ***                      */
    /* ------------------------------------------------------------------ */

    /**
     * @notice Transfers `amount` tokens from the caller to `recipient`.
     *
     * The decompiled output contained a large amount of redundant and
     * syntactically-invalid statements. All genuine behavioural checks
     * (non-zero recipient, sender not blocked, sufficient balance, etc.)
     * have been preserved below while dead-code and duplicates were removed.
     */
    function transfer(address recipient, uint256 amount)
        public
        override
        returns (bool)
    {
        /* 1. Non-zero recipient address check (was `require(address(arg0))`). */
        require(recipient != address(0), "ERC20: transfer to the zero address");

        /* 2. Anti-bot: sender must not be blocked (`storage_map_e`).        */
        require(!_isBlocked[_msgSender()], "Sniper blocked");

        /* 3. Trading must be active unless sender or recipient is excluded
              from maximum transaction limits (mirrors original intent).    */
        if (!tradingActive) {
            require(
                _isExcludedMaxTransactionAmount[_msgSender()] ||
                    _isExcludedMaxTransactionAmount[recipient],
                "Trading is not active."
            );
        }

        /* 4. Standard balance check. */
        uint256 senderBalance = _balances[_msgSender()];
        require(
            senderBalance >= amount,
            "ERC20: transfer amount exceeds balance"
        );

        /* 5. Execute transfer. */
        unchecked {
            _balances[_msgSender()] = senderBalance - amount;
            _balances[recipient] += amount;
        }

        emit Transfer(_msgSender(), recipient, amount);
        return true;
    }

    /* ---------------------------------------------------- */
    /*           Remaining IERC20 standard methods          */
    /* ---------------------------------------------------- */

    function allowance(address owner, address spender)
        external
        view
        override
        returns (uint256)
    {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 amount)
        external
        override
        returns (bool)
    {
        _approve(_msgSender(), spender, amount);
        return true;
    }

    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) external override returns (bool) {
        uint256 currentAllowance = _allowances[sender][_msgSender()];
        require(
            currentAllowance >= amount,
            "ERC20: transfer amount exceeds allowance"
        );

        _transferInternal(sender, recipient, amount);

        unchecked {
            _approve(sender, _msgSender(), currentAllowance - amount);
        }

        return true;
    }

    /* ---------------------------------------------------- */
    /*                    Internal Logic                    */
    /* ---------------------------------------------------- */

    function _transferInternal(
        address sender,
        address recipient,
        uint256 amount
    ) private {
        require(recipient != address(0), "ERC20: transfer to the zero address");
        require(!_isBlocked[sender], "Sniper blocked");

        uint256 senderBalance = _balances[sender];
        require(
            senderBalance >= amount,
            "ERC20: transfer amount exceeds balance"
        );

        unchecked {
            _balances[sender] = senderBalance - amount;
            _balances[recipient] += amount;
        }

        emit Transfer(sender, recipient, amount);
    }

    function _approve(
        address owner,
        address spender,
        uint256 amount
    ) private {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }
}

